{
  "ubx_message": {
    "name": "UBX-CFG-USB",
    "class_id": "0x06",
    "message_id": "0x1b",
    "description": "USB configuration",
    "message_type": "get_set",
    "payload_length": {
      "fixed": 108
    },
    "payload_fields": [
      {
        "byte_offset": 0,
        "data_type": "U2",
        "name": "vendorID",
        "description": "Vendor ID. This field shall only be set to registered Vendor IDs. Changing this field requires special Host drivers."
      },
      {
        "byte_offset": 2,
        "data_type": "U2",
        "name": "productID",
        "description": "Product ID. Changing this field requires special Host drivers."
      },
      {
        "byte_offset": 4,
        "data_type": {
          "array_of": "U1",
          "count": 2
        },
        "name": "reserved0",
        "reserved": true,
        "description": "Reserved"
      },
      {
        "byte_offset": 6,
        "data_type": {
          "array_of": "U1",
          "count": 2
        },
        "name": "reserved1",
        "reserved": true,
        "description": "Reserved"
      },
      {
        "byte_offset": 8,
        "data_type": "U2",
        "name": "powerConsumption",
        "unit": "mA",
        "description": "Power consumed by the device"
      },
      {
        "byte_offset": 10,
        "data_type": "X2",
        "name": "flags",
        "description": "various configuration flags",
        "bit_fields": [
          {
            "bit_offset": 0,
            "bit_length": 1,
            "name": "reEnum",
            "description": "force re-enumeration"
          },
          {
            "bit_offset": 1,
            "bit_length": 1,
            "name": "powerMode",
            "description": "self-powered (1), bus-powered (0)"
          }
        ]
      },
      {
        "byte_offset": 12,
        "data_type": {
          "array_of": "CH",
          "count": 32
