      },
      {
        "byte_offset": 44,
        "data_type": {
          "array_of": "CH",
          "count": 32
        },
        "name": "productString",
        "description": "String containing the product name. 32 ASCII bytes including 0-termination."
      },
      {
        "byte_offset": 76,
        "data_type": {
          "array_of": "CH",
          "count": 32
        },
        "name": "serialNumber",
        "description": "String containing the serial number. 32 ASCII bytes including 0-termination. Changing the String fields requires special Host drivers."
      }
    ]
  }
}
